import React from 'react'

function TopButtons() {
    const cities = [
        {
            id:1,
            title: 'London'
        },
        {
            id:2,
            title: 'Sydney'
        },
        {
            id:1,
            title: 'Tokyo'
        },
        {
            id:1,
            title: 'Torronto'
        },
        {
            id:1,
            title: 'Paris'
        }
    ]

  return <div className='flex items-center justify-around'>
    {cities.map((city) => (
        <button className=' text-white text-lg font-medium'>{city.title}</button>
    ))}
  </div>;

}

export default TopButtons
